import React from "react";

import city from "../../data/city.json";
import "./City.css";

const City = () => {
  return (
    <div className="city-list">
      {city.map((item) => (
        <div className="" style={{ background: url(item.image) }}>
          <h2>{item.name}</h2>
          <h3>{item.subText}</h3>
        </div>
      ))}
    </div>
  );
};

export default City;
